/* Function  structure for function  `fn_get_fmlitems_by_pro_id` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_fmlitems_by_pro_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_fmlitems_by_pro_id`(proId varchar(70)) RETURNS int(11)
BEGIN
	return (select count(1) from tb_family_item where pro_id = proId);
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_fmlitem_count` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_fmlitem_count` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_fmlitem_count`(proId varchar(70)) RETURNS int(11)
BEGIN
	 return(
	select count(1) from tb_family_item where id in
(
SELECT distinct fml_item_id FROM tb_housepurchase_ticket WHERE ticket_state_id = '6' AND fml_item_id IN(SELECT id FROM tb_family_item WHERE pro_id = proId) AND is_del=0
)
);
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_fmls_by_pro_id` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_fmls_by_pro_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_fmls_by_pro_id`(proId varchar(70)) RETURNS int(11)
BEGIN
	declare c int;
	set c = (select count(1) from tb_family where pro_id = proId);
	return c;
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_half_count` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_half_count` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_half_count`(proId varchar(70)) RETURNS int(11)
BEGIN
	return (SELECT COUNT(1) FROM tb_family_item WHERE is_half IS NOT NULL AND pro_id=proId);
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_non_landbureau` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_non_landbureau` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_non_landbureau`(proId varchar(70)) RETURNS int(11)
BEGIN
	declare total_count int;
	declare only_child_count int;
	set only_child_count = (select count(1) from tb_family_item where only_child_number is not null and pro_id = proId);
	set total_count = (SELECT COUNT(1) FROM tb_family_item where pro_id = proId);
	return (total_count+only_child_count)*4;
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_onlychild_count` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_onlychild_count` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_onlychild_count`(proId VARCHAR(70)) RETURNS int(11)
BEGIN
	return (SELECT COUNT(1) FROM tb_family_item WHERE only_child_number IS NOT NULL AND pro_id=proId);
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_personal_subsidy_std` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_personal_subsidy_std` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_personal_subsidy_std`(proId varchar(70)) RETURNS float
BEGIN
	declare totalMoney int;
	declare onlychildCount int;
	declare halfCount int;
	declare noneHalfCount int;
	
	set totalMoney = (SELECT SUM(bonus) FROM tb_housepurchase_ticket WHERE fml_item_id IN(SELECT id FROM tb_family_item WHERE pro_id=proId));
	set onlychildCount = (fn_get_onlychild_count(proId));
	set halfCount = (fn_get_half_count(proId));
	set noneHalfCount = (fn_get_total_popu(proId) - halfCount);
	
	if noneHalfCount <= 0 
	THEN
		return 0.0;
	else 
		RETURN ((totalMoney-4*(onlychildCount+halfCount))/noneHalfCount)-4;
	end if;
    END */$$
DELIMITER ;

/* Function  structure for function  `fn_get_rcd_amount` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_rcd_amount` */;
