/* Function  structure for function  `fn_get_total_amount_by_pro_id` */

/*!50003 DROP FUNCTION IF EXISTS `fn_get_total_amount_by_pro_id` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` FUNCTION `fn_get_total_amount_by_pro_id`(proId varchar(70)) RETURNS float
BEGIN
	declare total float;
	set total = (SELECT SUM(bonus) FROM tb_housepurchase_ticket WHERE fml_item_id IN(SELECT id FROM tb_family_item WHERE pro_id = proId));
	if total is null then
		return 0;
	else
		return total;
	end if;
	
END */$$
