/* Procedure structure for procedure `sp_get_index_data` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_get_index_data` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_get_index_data`(proId varchar(70))
begin
	declare orgName varchar(255) default ''; /*所属组织*/
	DECLARE deptName VARCHAR(255) DEFAULT ''; /*部门*/
	DECLARE totalPros int DEFAULT 0; /*拆迁项目总数*/
	DECLARE totalArea float DEFAULT 0; /*拆迁总面积*/
	DECLARE totalBuildings INT DEFAULT 0; /*拆迁总栋数*/
	DECLARE removeFmls INT DEFAULT 0; /*拆迁户数*/
	DECLARE totalRemovePopulation INT DEFAULT 0; /*拆迁总人数*/
	DECLARE onlyChildCount INT DEFAULT 0; /*独生子女*/
	DECLARE transfered INT DEFAULT 0; /*已转户*/
	DECLARE socialsecurity int DEFAULT 0; /*已纳入社保*/
	SET orgName = (SELECT org.org_name FROM db_requisition_land.tb_account AS acc INNER JOIN db_requisition_land.tb_org AS org ON acc.org_id = org.id WHERE acc.id = proId LIMIT 1);
	SET deptName = (SELECT dept.dept_name FROM db_requisition_land.tb_account AS acc INNER JOIN db_requisition_land.tb_dept AS dept ON acc.dept_id = dept.id WHERE acc.id = proId LIMIT 1);
	set totalPros = (select count(1) from db_requisition_land.tb_project);
	set totalArea = (SELECT sum(requisition_area) FROM db_requisition_land.tb_project);
	set totalBuildings = (select sum(should_remove_buildings) from db_requisition_land.tb_project);
	SET removeFmls = (SELECT SUM(should_remove_houses) FROM db_requisition_land.tb_project);
	SET totalRemovePopulation = (SELECT SUM(should_remove_population) FROM db_requisition_land.tb_project);
	set onlyChildCount = (SELECT COUNT(1) FROM db_requisition_land.tb_family_item where only_child_number is null or only_child_number = '');
	SET transfered = (SELECT COUNT(1) FROM tb_transfer_household_info);
	set socialsecurity = (SELECT COUNT(1) FROM tb_socialsecurity_info);
	
	select 	deptName,
		orgName,
		totalPros,
		totalArea,
		totalBuildings,
		removeFmls,
		totalRemovePopulation,
		onlyChildCount,
		transfered,
		socialsecurity;
end */$$
DELIMITER ;

/* Procedure structure for procedure `sp_statistics` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_statistics` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_statistics`(IN start_date date,IN end_date date,in page_index int,in page_size int)
BEGIN
	
	SELECT 	
		distinct
		p.`pro_name` AS proName,#pro name
		fn_get_fmls_by_pro_id(p.id) AS totalFmlCount, #fml count
		fn_get_fmlitems_by_pro_id(p.id) AS totalFmlItems, #fml items count
		fn_get_total_amount_by_pro_id(p.`id`) AS totalAmount, #total amount
		fn_get_non_landbureau(p.`id`) AS nLandBureauAmount, #non-land-bureau amount
		fn_get_total_amount_by_pro_id(p.`id`) - fn_get_non_landbureau(p.`id`) AS landBureauAmount, # land bureau amount
		fn_get_rcd_fml_count(p.id) as rcdFmlCount, #received fml count
		fn_get_fmlitem_count(p.id) as rcdFmlItems, #received fml item count
		fn_get_rcd_amount(p.id) as rcdAmount, #received amount
		fn_get_fmls_by_pro_id(p.id) - fn_get_rcd_fml_count(p.id) as nrcdFmlCount, #non received fml count
		fn_get_fmlitems_by_pro_id(p.id) - fn_get_fmlitem_count(p.id) as nrcdFmlItems, #non received fml item count
		fn_get_total_amount_by_pro_id(p.`id`) - fn_get_rcd_amount(p.id) as nrcdAmount,	
		money_unit as moneyUnit,
		other_money_unit as otherMoneyUnit,
		
		fn_get_onlychild_count(p.`id`) as onlyChildCount,	#the only child count
		fn_get_half_count(p.`id`) as halfCount,	#the half fml count
		fn_get_total_popu(p.`id`) as totalPopu,	#the total population
		fn_get_personal_subsidy_std(p.`id`) as personalSubsidyStd,
		4 as nonLrbStd
		
	FROM tb_project AS p
		LEFT JOIN tb_family AS f ON f.`pro_id` = p.`id`
	where p.id in(
		select distinct fi.pro_id from tb_family_item as fi where fi.id in(SELECT fml_item_id FROM tb_housepurchase_ticket WHERE create_date BETWEEN start_date AND end_date)
	) limit page_index,page_size;
    END */$$
DELIMITER ;

